        // const anotherOne = JSON.parse(cart)
        setList(JSON.parse(cart));
        // setList(JSON.parse(cart))
    }, [])
    console.log(list);
    return <ul>
        <h1>Cart </h1>
        {list.map((item, i) => {
            console.log(item);

            return <div className='d-flex text-center m-auto'><li key={i} className='m-5'>{item.name}</li><li key={i}>{item.pricePerGram}</li></div>
        })}
    </ul >
}
